contracts/Marketplace.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "./types/TokenTypes.sol";
import "./NFT.sol";
import "./events/Events.sol";
import "./types/ListingTypes.sol";

contract Market is Events {
    NFT private _nftContract;

    uint256 private _index = 0;

    constructor(address nftAddress) {
        _nftContract = NFT(nftAddress);
    }

    mapping(uint256 => ListingType) public _listing;

    function _createListing(
        uint256 tokenId,
        uint256 price,
        address _owner
    ) external returns (bool) {
        require(
            _nftContract._ownerOf(tokenId)._owner == _owner,
            "No Token Minted!"
        );

        // check if token is already listed
        for (uint256 _indi = 1; _indi <= _index; _indi++) {
            if (_listing[_indi]._token._id == tokenId) {
                require(
                    _listing[_indi]._active == false,
                    "Token already listed"
                );
                _listing[_indi]._price = price;
                _listing[_indi]._active = true;
                return true;
            }
        }
        _index += 1;
        _listing[_index] = ListingType(
            _index,
            price,
            _nftContract._ownerOf(tokenId),
            true
        );
        return true;
    }

    function _cancelListing(uint256 _listingId, address _owner) public {
        ListingType storage list = _listing[_listingId];
        require(list._active, "NFT not Listed");
        require(list._token._owner == _owner, "You are not the seller");
        list._active = false;
    }

    function _buyToken(uint256 _listingId, address buyer) external payable {
        ListingType storage list = _listing[_listingId];
        require(list._active, "NFT not Listed");
        require(msg.value >= list._price, "Insufficient Balance");
        _nftContract._transferFrom(list._token._owner, buyer, list._token._id);
        _editListing(list._token._id, _listingId, buyer, list._price, false);
    }

    function _getListings() public view returns (ListingType[] memory) {
        ListingType[] memory _toks = new ListingType[](_index);
        uint256 _idx = 0;
        for (uint256 _indi = 1; _indi <= _index; _indi++) {
            if (_listing[_indi]._active) {
                _toks[_idx] = _listing[_indi];
            }
        }
        return _toks;
    }

    function _editListing(
        uint256 _tokenId,
        uint256 _listingId,
        address _owner,
        uint256 newPrice,
        bool _isListed
    ) public {
        ListingType storage list = _listing[_listingId];
        require(list._active, "NFT not Listed");
        require(
            _nftContract._ownerOf(_tokenId)._owner == _owner,
            "You are not the seller"
        );
        list._price = newPrice;
        list._active = _isListed;
        list._token._owner = _owner;
    }
}

contracts/NFT.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "./helpers/String.sol";
import "./types/TokenTypes.sol";
import "./events/Events.sol";

contract NFT is Events, Strings {
    uint256 private _index = 0;
    mapping(string => bool) private _title;
    mapping(string => bool) private _assets;
    mapping(uint256 => TokenType) private _tokens;
    mapping(address => uint256) private _balance;

    function _mint(
        string memory _name,
        string memory _asset,
        string memory _category,
        string memory _type,
        address _sender
    ) external returns (uint256) {
        _index += 1;
        require(!_assets[_asset] && !_title[_asset], "Dublicate NFT");
        _title[_name] = true;
        _assets[_asset] = true;
        _tokens[_index] = TokenType(
            _index,
            _sender,
            _asset,
            _category,
            _type,
            _name
        );
        emit Transfer(address(0), _sender, _index);
        _balance[_sender] != 0 ? _balance[_sender] += 1 : _balance[_sender] = 1;
        return _index;
    }

    function _ownerOf(uint256 _id) external view returns (TokenType memory) {
        return _tokens[_id];
    }

    function _balanceOf(address _owner) public view returns (uint256) {
        return _balance[_owner];
    }

    function _transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) external {
        require(
            _from == _tokens[_tokenId]._owner,
            "The from address does not own the token"
        );
        require(_to != address(0), "Cannot transfer to the zero address");
        _tokens[_tokenId]._owner = _to;
        _balance[_from] -= 1;
        _balance[_to] += 1;
        emit Transfer(_from, _to, _tokenId);
    }

    function _getTokens(address _own)
        external
        view
        returns (TokenType[] memory)
    {
        uint256 count = _balanceOf(_own);
        if (count == 0) {
            return new TokenType[](0);
        }
        TokenType[] memory _toks = new TokenType[](count);
        uint256 _idx = 0;
        for (uint256 _indi = 1; _indi <= _index; _indi++) {
            if (_tokens[_indi]._owner == _own) {
                _toks[_idx] = _tokens[_indi];
                _idx += 1;
            }
        }
        return _toks;
    }

    function _isExists(string memory _asset, string memory _name)
        external
        view
        returns (bool)
    {
        return _assets[_asset] || _title[_name];
    }

    function _getContractAddress() public view returns (address) {
        return address(this);
    }
}

